# Dubinino, Republic of Buryatia

}}
Dubinino () is a rural locality (a selo) in Kabansky District, Republic of Buryatia, Russia. The population was 337 as of 2010. There are 2 streets.
Geography
Dubinino is located  north of Kabansk (the district's administrative centre) by road. Inkino is the nearest rural locality.
